// SPDX-License-Identifier: MIT
pragma solidity 0.8.13;

import "erc721a/contracts/extensions/ERC721AQueryable.sol";
import "openzeppelin-solidity/contracts/access/Ownable.sol";

contract NftQueryable is ERC721AQueryable, Ownable {
  bool antibot;

  uint112 nftPrice;
  uint112 maxSupply;

  uint112 startTime;
  uint112 endTime;

  string private baseUri;

  event BuyNft(address to, uint256 ethAmount, uint256 quantity, uint256 timestamp);

  constructor(string memory _name, string memory _symbol, string memory baseUri_, uint112 _nftPrice, uint112 _maxSupply, bool _antibot, uint112 _startTime, uint112 _endTime) ERC721A(_name, _symbol) {
    nftPrice = _nftPrice;
    maxSupply = _maxSupply;
    antibot = _antibot;
    baseUri = baseUri_;
    startTime = _startTime;
    endTime = _endTime;
  }

  function _startTokenId() internal override view virtual returns (uint256) {
    return 1;
  }

  function _baseURI() internal view virtual override returns (string memory) {
    return baseUri;
  }

  function setBaseUri(string memory _newUri) external onlyOwner {
    baseUri = _newUri;
  }

  function buyNft() public payable {
    require(msg.value > nftPrice, "Have to buy atleast one");
    require(startTime > block.timestamp && endTime < block.timestamp, "Ended or not started yet");
    if(antibot){
      require(address(msg.sender).balance > 0.0001 ether, "AntiBot: Insufficient account balance");
    }
    uint quantity = msg.value/nftPrice;
    payable(owner()).transfer(msg.value);
    _mint(msg.sender, quantity);
    emit BuyNft(msg.sender, msg.value, quantity, block.timestamp);
  } 

  function setAntibot(bool _state) public {
    antibot = _state;
  }
}
